INSERT INTO `pn_posts` VALUES (1,'ef','<span style=\"background-color:#FF9900;\">fe</span>',NULL,1366500480,1366500676,'trash'),(2,'fe','&nbsp;&nbsp;&nbsp;&nbsp;few份额我发巍峨',NULL,1366500660,1366500721,'trash'),(3,'tr','rgr',NULL,1366505820,1366505850,'trash'),(4,'tr','rgr',NULL,1366505880,1366505901,'trash'),(5,'fewfwer3','fewfewfwef<img src=\"/asset/editor/../../upload/editor/image/20130423/20130423233020_55587.png\" width=\"119\" height=\"84\" alt=\"\" /><img src=\"/upload/editor/image/20130605/20130605103049_71538.png\" width=\"371\" height=\"326\" alt=\"\" />','re',1366731120,1370399473,'trash'),(6,'fref','f34f34f',NULL,1366739700,1366739729,'trash'),(7,'test','<div align=\"left\">\n	<p>\n		<br />\n	</p>\n	<p>\n		你一直问，他们何以如此的丧心病狂，他们却觉得自己已经非常的克制忍让。\n	</p>\n你一直问，他们何以如此的颠倒黑白，他们却觉得自己已经非常的公正坦率。<br />\n	<div>\n		你一直问，他们何以如此的包庇凶手，他们却觉得自己已经非常的愧对炮友。<br />\n	</div>\n你一直问，他们何以如此的掩盖真相，他们却觉得自己已经非常的透明开放。<br />\n</div>\n<p align=\"left\">\n	你一直问，他们何以如此的生活腐化，他们却觉得自己已经非常的艰苦朴素。\n</p>\n<p align=\"left\">\n	你一直问，他们何以如此的骄横傲慢，他们却觉得自己已经非常的姿态低下。&nbsp;\n</p>','hanhan',1370586840,1370586866,'trash'),(8,'皮克斯的勇敢','<div style=\"margin:0px;padding:0px;\">\n	最近先后上映了两部动画，分别是《马达加斯加3》和《勇敢传说》，奔着以人为本的原则选择看了后者。幸好没有犯贱先看影评，一片空白地走进影院，果不其然，我也看到了一个跟以往不一样的皮克斯动画，故事挺深刻而且有点儿成人了，由于看的晚上10点那场，观众里没有小孩儿，否则魔度一出场估计得吓一跳。\n</div>\n<div style=\"margin:0px;padding:0px;\">\n	<br />\n</div>\n<div style=\"margin:0px;padding:0px;\">\n	网上有朋友说这部动画没有想象中的好看，跟以往皮克斯风格反差太大，剧情一猜一准儿。还有朋友说这就是皮克斯的勇气，勇于改变。我还是偏向后者，因为更贴近影片主题，这次虽然风格变了，但是情节我认为很好看，因为让我想起很多来自我家庭的往事来，这也应该是我对动画最高的评价。\n</div>\n<div style=\"margin:0px;padding:0px;\">\n	<br />\n</div>\n<div style=\"margin:0px;padding:0px;\">\n	我们老一辈的人爱说80后是颓废的、毫无责任心的一代，其实不只80后，年轻人不懂的事儿多了，你们别老光动嘴说，我们不会，做长辈的你们得教我们啊，这就涉及到了教育的方法，不过教育谈何容易，所以当我看到王后给公主穿上紧身衣并关切地欲言又止的时候，我就知道，她想试着告诉公主举办比武招亲的原因，为什么不经过你同意就要把你嫁出去，可后来王后还是住口了，可能是不想让女儿知道自己承担了太多责任，她认为这是出于对女儿的爱，女儿却认为她即将失去自由，这里我就想，长辈要是对晚辈多说些“为什么”是不是能更好些？\n</div>\n<div style=\"margin:0px;padding:0px;\">\n	<br />\n</div>\n<div style=\"margin:0px;padding:0px;\">\n	美国的动画电影到处充斥着以不同形式对教育方法的探讨，因为这本就是个复杂但又必须经历的过程，影片给了我们一个暗示，大部分长辈们都是不会教育的，但是为了你，就必须要生硬地给你灌输一些“荒谬”的理念，这过程几乎是命令式的。王后希望女儿成为标准的公主，所以她命令女儿不许练习射箭，不许把弓箭放到餐桌上，吃东西不许吧唧嘴。看到这儿我就联想到这和我妈妈不许我背着笔记本电脑到处走，没事儿总盯着电脑上网一样，在她们的世界里，弓箭和电脑都是没用的。直至今日，我都很佩服我的远见，先在家里设置了无线网，再给爹妈一人一个ipod touch，给他们装了一堆软件，周末回家跟妈妈聊聊八卦，跟爸爸聊聊野史，彻底让他们走进了我的世界他们才知道原来我的世界也这么有趣味，不亦乐乎？所以这时的王后估计真的不知道女儿的弓箭还能捕鱼吧~\n</div>\n<div style=\"margin:0px;padding:0px;\">\n	<br />\n</div>\n<div style=\"margin:0px;padding:0px;\">\n	看完影片我第一感觉就是我们“教育”的可悲，在我们这个国家里把“教育”就理解成了数理化，分儿够了说明对你的“教育”就成功了，这完全脱离的了人与人的关系层面，成果也就可想而知了。那么在皮克斯的世界里对教育是怎么理解的呢？那就是王后吃了公主的魔法蛋糕后摘下王冠脱掉礼服变成了一只熊，跟着公主跑出了城堡走进了女儿的世界，在和女儿寻找解除魔法的旅行中相互理解，相互学习。长辈在教育你的同时也是被教育的过程，教育其实是平等相互的。\n</div>\n<div style=\"margin:0px;padding:0px;\">\n	<br />\n</div>\n<div style=\"margin:0px;padding:0px;\">\n	希望所有为人父母的长辈们也学会放下威严与虚荣，变成一头熊走到孩子们的世界中去试着理解他们，也许在不久的将来真的会出现这样的画面：你的孩子站在台上向朋友传播着责任与信任，而你却站在台下举起熊爪鼓励孩子追求属于自己的梦想，做出属于自己的决定。\n</div>','brave',1340383260,1375148124,'public'),(9,'熊猫大战孔雀和狼','<p>\n	今儿特意请假去电影院看了《功夫熊猫2》，总体剧情还是非常的俗套，连我这个猜电影结局一直不准的人在电影开始半个小时的时候甚至都可以准确的猜出熊猫是用什么手段战胜孔雀的了。不过对于一部3D动画来讲都是可以说得通的，而且对于这部电影来说，拍摄续集本身是很难的，因为在第一部的最后熊猫已经不是熊猫了，是龙战士了，非常厉害，几乎谁的打不过它了，这种情况之下再塑造一个比龙战士武功还厉害的反派就显得很牵强。结果第二部就大肆炒作熊猫的身世之谜，先让熊猫的内心虚弱下来，挨几次揍，最后再让它搞懂，靠，我管鹅叫爹怎么了？它给我吃给我喝还让我学武功成为龙战士的，所以它就是我爹。带着这个信念，熊猫顺利地干掉了孔雀和恶狼们。\n</p>\n<p>\n	<br />\n</p>\n<p>\n	但是抛开剧情不谈，影片的3D效果还是非常出色的，这次梦工厂吸取了之前3D影片的教训，除了人物和场景更有层次感之外，许多的镜头都是为了3D效果特意设计的，还有人物的毛发，质感都堪称完美，看得我不由地感叹，这要是我们的熊猫该多好啊.....\n</p>\n<p>\n	<br />\n</p>\n我们祖宗留下来的好玩意儿，让美国公司体现的淋漓尽致，这句话说的确实讽刺，不知道若干年以后，影片里的建筑，烟花甚至是熊猫还有没有人承认是中国的。我们的历史居然让外国用科技给还原了，而且我们对正在流失的文化却毫不知觉，国外拍卖圆明园的石像很多中国人都说那是我们的，花钱去买下来，我都不觉的那些石头能代表我们什么，而且我们只知道洋人抢走的只是我们的古玩而已，殊不知文化也被抢走了大半了。在我上班和回家的路上，有时候不经意帮外国人开下门或是扶一下门把手，人家都非常认真地跟你说谢谢，而且说的是字正腔圆的中国话，但我上班的一路上最多给老年人让过4次座儿，能听到一句谢谢就不错了，我上班儿再累站会儿也没什么，您心里骂我也好但嘴里说句谢谢怎么就那么难，我碰到的外国人其实他们真的不太会中文，但是谢谢这两个字人家说的却如此熟练，极有感情，为什么？因为知礼节已经深入他们骨髓，而礼仪之邦却只挂在我们嘴边儿上。嘴边儿的肉不咽下去迟早要被别人叼走，最可悲是叼走了嚼吧嚼吧还卖给你，哎.....不多说了，但愿我们永远有肉吃。','panda',1307011320,1375148135,'public'),(10,'一回学校，毕业了，一出学校，工作了。','<p>出来混已经半年多了，也渐渐适应了外面的游戏方式，但自己到底喜不喜欢，我也说不清楚，总之是，一天晚上接到了来自班主任的电话的时候，他说：王维，该回来答辩了。心中顿时感慨万千。刚上大一的时候，听学长们说根本没有答辩，因为我们毕业不穿学士袍跟圆帽子照相，也就固然没有答辩等之说了。所以要是在上学期间听到毕业要答辩我会捧腹大笑，因为别人都在笑，我不笑不就是怪胎喽？但是，当我接到班主任的电话的时候，确实有一种说不出的哀叹，这说明了一个问题......</p>\n\n<p>于是乎，上周请了三天假，扣了我200多块，风尘仆仆来到学校，第一天答辩，第二天写自我鉴定，第三天收拾东西滚蛋，给下届的小孩儿们腾出伤感的空间来。</p>\n\n<p>我是宿舍最后一个搬走的，收拾东西的时候宿舍已然一片狼藉，就像轮回到了当初搬宿舍的情景之中，一切，又回到了起点，然而这过程，让人百感交集。</p>\n\n<p><img alt=\"\" src=\"/upload/editor/image/20130614/20130614163118_84597.jpg\" /></p>\n\n<p><span>（满地的&ldquo;废物&rdquo;，麻烦宿舍环卫的大爷了）</span></p>\n\n<p><img alt=\"\" src=\"/asset/editor/../../upload/editor/image/20130614/20130614163058_38228.jpg\" /></p>\n\n<p><span style=\"color:#333333;font-family:Tahoma, Verdana, STHeiTi, simsun, sans-serif;line-height:19px;background-color:#FFFFFF;\">（当初来学校报道，智华是第一个到的，我是第二个到的，如今他倒数第二走的，我倒数第一走的，正应了上面那句话，一切都是轮回。）</span></p>\n\n<p><img alt=\"\" src=\"/upload/editor/image/20130614/20130614163114_67862.jpg\" /></p>\n\n<p><span style=\"color:#333333;font-family:Tahoma, Verdana, STHeiTi, simsun, sans-serif;line-height:19px;background-color:#FFFFFF;\">（晚上我们在墙上练字，畅想有一天我们能站在讲台上分享我们的经验和理想）</span></p>\n\n<p><img alt=\"\" src=\"/upload/editor/image/20130614/20130614163108_97507.jpg\" /></p>\n\n<p><span style=\"color:#333333;font-family:Tahoma, Verdana, STHeiTi, simsun, sans-serif;line-height:19px;background-color:#FFFFFF;\">（这些书我们也读过，很薄的书，却越读越厚，我们知道，光读是不行的......）</span></p>\n\n<p><img alt=\"\" src=\"/upload/editor/image/20130614/20130614163102_18946.jpg\" /></p>\n\n<p><span style=\"color:#333333;font-family:Tahoma, Verdana, STHeiTi, simsun, sans-serif;line-height:19px;background-color:#FFFFFF;\">（曾经写过的东西，书包里常带着，如今却踩在脚下，当初的心血&mdash;&mdash;我长大了么？）</span></p>\n\n<p><img alt=\"\" src=\"/upload/editor/image/20130614/20130614163106_49789.jpg\" /></p>\n\n<p><span style=\"color:#333333;font-family:Tahoma, Verdana, STHeiTi, simsun, sans-serif;line-height:19px;background-color:#FFFFFF;\">（一个哨子，我跟智华说，等你有了女朋友你就把这个送给她，智华随手就给扔了...）</span></p>\n\n<p><img alt=\"\" src=\"/upload/editor/image/20130614/20130614163108_97244.jpg\" /></p>\n\n<p style=\"color:#333333;font-family:Tahoma, Verdana, STHeiTi, simsun, sans-serif;background-color:#FFFFFF;\">（我跟智华说：哥虽然吉他弹的不好，但是哥可以骄傲地说，哥曾经弹过）</p>\n\n<p style=\"color:#333333;font-family:Tahoma, Verdana, STHeiTi, simsun, sans-serif;background-color:#FFFFFF;\">（我跟智华说：哥虽然轮滑滑的不好，但是哥可以骄傲地说，哥曾经滑过）</p>\n\n<p style=\"color:#333333;font-family:Tahoma, Verdana, STHeiTi, simsun, sans-serif;background-color:#FFFFFF;\">（我跟智华说：看，凡是能证明哥在学校待过的东西哥全没带走。智华大笑过瘾，我心里却想，真的什么都没带走么？三年，不可能什么都没带走......）</p>\n\n<p><img alt=\"\" src=\"/upload/editor/image/20130614/20130614163117_81841.jpg\" /></p>\n\n<p><span style=\"color:#333333;font-family:Tahoma, Verdana, STHeiTi, simsun, sans-serif;line-height:19px;background-color:#FFFFFF;\">（以前听马明说，要干嵌入式这行要去日本岛发展，于是到网上找了很多资料，背英语之余又增加了平假名和片假名，多么荒唐，谁能告儿我嵌入式是什么？）</span></p>\n\n<p><img alt=\"\" src=\"/upload/editor/image/20130614/20130614163113_54393.jpg\" /></p>\n\n<p><span style=\"color:#333333;font-family:Tahoma, Verdana, STHeiTi, simsun, sans-serif;line-height:19px;background-color:#FFFFFF;\">（故事又到了第二个章节，转眼间，小伙子拿起枪奔赴事业，第一份工作开始了.....）</span></p>\n\n<p><img alt=\"\" src=\"/upload/editor/image/20130614/20130614163111_13454.jpg\" /></p>\n\n<p><span style=\"color:#333333;font-family:Tahoma, Verdana, STHeiTi, simsun, sans-serif;line-height:19px;background-color:#FFFFFF;\">（真是很讨厌学校，可有趣的是，工作需要我潜伏在学校，在这里，我猛然发现，我的视角从第一人称变成了第三人称。）</span></p>\n\n<p><img alt=\"\" src=\"/upload/editor/image/20130614/20130614163104_39836.jpg\" /></p>\n\n<p><span style=\"color:#333333;font-family:Tahoma, Verdana, STHeiTi, simsun, sans-serif;line-height:19px;background-color:#FFFFFF;\">（极其重视英语的学校，每个月都有英语表演，配音比赛，嘉年华。全口语表演。据说下学期就有高中部了，全部采用英语教材，外教，在家上完三年高中直接考美国大学，真周到，真羡慕，何来留学梦呢？）</span></p>\n\n<p><img alt=\"\" src=\"/upload/editor/image/20130614/20130614163100_59061.jpg\" /></p>\n\n<p><img alt=\"\" src=\"/upload/editor/image/20130614/20130614163116_38025.jpg\" /></p>\n\n<p><span style=\"color:#333333;font-family:Tahoma, Verdana, STHeiTi, simsun, sans-serif;line-height:19px;background-color:#FFFFFF;\">（该玩玩，该学学，从中我感受到了快乐的学习，于我却是一种再无机会的奢望。）</span></p>\n\n<p><img alt=\"\" src=\"/upload/editor/image/20130614/20130614163119_58221.jpg\" /></p>\n\n<p><span style=\"color:#333333;font-family:Tahoma, Verdana, STHeiTi, simsun, sans-serif;line-height:19px;background-color:#FFFFFF;\">有些同学问我，留恋学校吗，我说，不留恋。同学又说，那为什么伤感，我说：可能是对被迫改变了生活方式而感慨吧，以前用四肢爬行，很慢但很容易找到平衡， 如今须要两脚直立奔跑了，你总得让我为两只抛弃的手感伤一下吧，毕竟20年它的辛劳让我感动。</span></p>','10',1275970620,1376896904,'public'),(11,'该走的总是要走','<p>昨天，终于看完了《草样年华3》，这个系列我已经读了5年了，喜欢孙睿的文字也已经5年了。5年前的时候，身边喜欢孙睿的读者只有我哥，我是后者居上，厌倦学习到极限才去看小说的，开始也并不喜欢，我哥看了一半，我就接着书签往后翻了两眼，结果是：上瘾了。原因是：很搞笑。犹记得第二个星期，学校组织到操场举办运动会，我看到很多人手里拿着《草样年华》，书签还插在了第一章，她们问我：&ldquo;孙睿的《草样年华》，看过么？特逗。&rdquo;</p>\n\n<p>我说：&ldquo;用我背一下最后几段给你听听么？&rdquo;</p>\n\n<p>霎那间，时间仿佛停止，只有风在动，春风不解风情，吹动少年的心。</p>\n\n<p>女孩子崇拜地看着我，我则自我崇拜地看着她。</p>\n\n<p>也是从那天起，我突然觉得，读书还是有用的。</p>\n\n<p>也是从那天起，我喜欢孙睿的文字。喜欢作品里人物的嬉笑怒骂，一直喝酒喝道天亮，喜欢临考试还在安然入睡而脑袋里没有一条公式，喜欢为了补考及格使用的各种天才的手段，喜欢身边喜欢自己的女孩儿伤心远走自己依然沉沦世俗，毫无顾忌的挥霍青春。</p>\n\n<p>&nbsp;</p>\n\n<p>15岁的时候，我们喜欢抱怨，20岁的时候，我们喜欢成熟。不能说是自己喜欢上的，用孙睿的话说：有时候&ldquo;嘎巴儿&rdquo;一声，你就觉得自己老了，也就是1秒钟的事儿，造成这&ldquo;嘎巴儿&rdquo;的原因有很多，老是一个心理状态，用文艺点儿的词说那就是：成熟了。而你不得不承认。</p>\n\n<p>所以当我阅读《草3》的时候，没有5年前的激情了，没有5年前的乐呵了，有的文字成熟了，有的只是叹红尘流逝不复返，青春苟延残喘。里面的文字依然幽默，但是，当你意识到青春正在无法挽回的流逝的时候，你还笑得出来么？</p>\n\n<p>时隔五年，孙睿说：《草3》是我告别青春的作品，以后要写什么，怎么写，我还没有想好。</p>\n\n<p>可能成熟了以后，我们都不知道该往哪里走吧。</p>\n\n<p>年轻的时候，我们为荷尔蒙而活，现在荷尔蒙没了，我们该为自己活了。</p>\n\n<p>因为青春已一去不复返。</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>今天是michael jackson的葬礼，22点开始直播，我不想看。还是留给喜欢看的人看吧。人都死了，再悼念惋惜多没意思。但对于mj来说是一种解脱，他终于摆脱负面新闻了。我由衷的为他高兴。</p>\n\n<p>看到michael jackson跟看到《草样年华》一样巧合。我借给同学哈狗帮的CD，同学觉得过意不去，就把刚买的历史演唱会A面借给了我，从此一发而不可收，那天真是奇妙的一天，因为从同学手里接过光盘的那天起，我有了信仰。</p>\n\n<p>可没想到啊，就这么&ldquo;嘎巴儿&rdquo;一声，身边的很多东西似乎都没了，仔细一想，其实也没什么，该走的总是要走。人走了信仰却还在，它就像一把利刃，在我心里刻下痕迹，永不磨灭。</p>\n\n<p>&nbsp;</p>\n\n<p>最后，真心祝愿Michael一路走好。谢谢孙睿那曾经灿烂鲜活的青春。</p>\n\n<p>&nbsp;</p>','11',1246982760,1376896790,'public'),(12,'日的记：2009年5月29日','<p>\n	&nbsp;以前周围人给我的感觉是,很明白的道理告诉他们却使得他们又很难理解。现在终于知道，原来道理朴素的简单，实行它并且持之以恒那是困难的——不就是这样子么?\n</p>\n<p>\n	&nbsp;\n</p>\n<p>\n	<span style=\"line-height:1.5;\">成功人士是怎么成功的？这个问题在杂志上比比皆是。你会在某一天迷茫地拨着遥控器，突然在电视上看到成功人士的访谈节目，结果你驻足观看，你觉得新鲜，你觉得荧幕上的人即将告诉你答案，告诉你秘诀！你心里暗骂节目主持人，这个傻逼怎么还不问人家是怎么成功的。在你的积极诅咒之下，主持人也终于忍不住了，他问嘉宾成功的秘诀，结果你只在这瞬间惊喜交加，随后却瞠目结舌，无比失望，你会问自己，怎么这秘诀如此简单，谁都知道的秘诀算是秘诀吗？只是&nbsp;短暂的自问，随即跳起来下了结论：成功人士都是骗子，是吝啬鬼！</span>\n</p>\n<p>\n	<span style=\"line-height:1.5;\"><br />\n</span>\n</p>\n<p>\n	以前看到许多成功人士站在台上侃侃而谈，挥舞中带有激情，言谈中带有责任，你会感觉到原来快乐是这么的简单，他们会在台上告诉你，不要有自卑感——这怎么可能呢？以前在书店随手翻着一本书，作者在里面给有气质的女孩子下了一个结论：所谓有气质的女孩子，她从来不跟别人讨论她用过什么样的名牌化妆品，什么牌子的美肤霜最贵，什么牌子的挎包在手上会显得更精致，她从来都不和别人攀比，从来不嫉妒别人，因为她们根本就没有自卑感。\n</p>\n<p>\n	<br />\n</p>\n<p>\n	为什么？他们为什么这么成功？他们为什么那么那么的成功？！你在心里不断让这些问题盘旋，你苦恼，你无助！你用整整一天的时间想这些问题，你越想越嫉妒！越想越失败！结果你气急败坏，你疯狂地捶打着墙，砸地板，扔花瓶，你被气晕了，完全不省人事了，等你醒来的时候，发现你躺在医院里，手上打着点滴，屋子出奇的静，只有心电图的滴答声，你突然发现，你已经在这里躺了一个月了，你看着心电图，吊瓶，以及白色床单和枕头，感谢它们陪伴你一个月，这是个多么充实的一个月啊。\n</p>','12',1243579620,1371199449,'public'),(13,'测试行距','测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距测试行距','13',1371623160,1371623216,'draft'),(14,'编译安装Mysql-5.6.12','<p>\n	一.<span style=\"line-height:1.5;\">yum安装基本依赖</span> \n</p>\n<pre class=\"prettyprint brush:bash;\">su root\n\nLANG=C\n\nyum -y install gcc gcc-c++ autoconf libjpeg libjpeg-devel libpng libpng-devel \nfreetype freetype-devel libxml2 libxml2-devel zlib zlib-devel glibc glibc-devel \nglib2 glib2-devel bzip2 bzip2-devel ncurses ncurses-devel curl curl-devel\ne2fsprogs e2fsprogs-devel krb5 krb5-devel libidn libidn-devel openssl \nopenssl-devel openldap openldap-devel nss_ldap openldap-clients openldap-servers \nzip unzip man perl-CPAN cmake bison\n\nyum update</pre>\n<br />\n二.创建安装目录\n	mkdir -p /usr/local/webserver/lnmp &nbsp; &nbsp; &nbsp;&nbsp;<br />\n<pre class=\"prettyprint brush:bash;\">mkdir -p /usr/local/webserver/lnmp/vim \nmkdir -p /usr/local/webserver/lnmp/mysql \nmkdir -p /usr/local/webserver/lnmp/php \nmkdir -p /usr/local/webserver/lnmp/nginx </pre>\n<p>\n	三.编译安装配置mysql&nbsp;\n</p>\n<p>\n	&nbsp;1.创建mysql组，添加mysql用户并放到mysql组中\n</p>\n<pre class=\"prettyprint brush:bash;\">groupadd mysql  \nuseradd -g mysql mysql </pre>\n<p>\n	2.编译&amp;&amp;安装\n</p>\n<pre class=\"prettyprint brush:bash;\">tar zxvf mysql-5.6.12.tar.gz \ncd mysql-5.6.12/ \n</pre>\n<pre class=\"prettyprint brush:bash;\">cmake . -DCMAKE_INSTALL_PREFIX=/usr/local/webserver/lnmp/mysql/ \\ \n-DEXTRA_CHARSETS=all \\ \n-DWITH_READLINE=1 \\ \n-DWITH_SSL=yes \\ \n-DWITH_EMBEDDED_SERVER=1 \\ \n-DENABLED_LOCAL_INFILE=1 \\ \n-DWITH_INNOBASE_STORAGE_ENGINE=1 \\ \n-DWITH_PARTITION_STORAGE_ENGINE=1 \nmake &amp;&amp; make install\ncd ../</pre>\n<p>\n	3.在mysql安装根目录下创建mysql数据库存放路径&nbsp;\n</p>\n<pre class=\"prettyprint brush:bash;\">mkdir -p /usr/local/webserver/lnmp/mysql/3306/data/  \nmkdir -p /usr/local/webserver/lnmp/mysql/3306/binlog/ \nmkdir -p /usr/local/webserver/lnmp/mysql/3306/relaylog/  </pre>\n<p>\n	<br />\n</p>\n<p>\n	4. 给目录的所有者添加w权限， mysql安装路径下所有目录及文件所有者和所有组都是mysql&nbsp;\n</p>\n<pre class=\"prettyprint brush:bash;\">chmod +w /usr/local/webserver/lnmp/mysql  \nchown -R mysql:mysql /usr/local/webserver/lnmp/mysql  </pre>\n5. 以mysql用户帐号的身份建立数据表：&nbsp;\n<p>\n	<br />\n</p>\n<pre class=\"prettyprint brush:bash;\">/usr/local/webserver/lnmp/mysql/scripts/mysql_install_db \\\n--basedir=/usr/local/webserver/lnmp/mysql \\\n--datadir=/usr/local/webserver/lnmp/mysql/3306/data \\\n--user=mysql</pre>\n<p>\n	<br />\n</p>\n<p>\n	6. 创建my.cnf配置文件：\n</p>\n<p>\n	<br />\n</p>\n<pre class=\"prettyprint brush:bash;\">cd /usr/local/webserver/lnmp/mysql\ncp support-files/my-default.cnf  3306/my.cnf \nvim 3306/my.cnf</pre>\n<p>\n	<br />\n</p>\n<p>\n	<br />\n</p>\n<p>\n	7.把my.cnf中内容替换成\n</p>\n<pre class=\"prettyprint brush:bash;\">[mysqld] \n# Remove leading # and set to the amount of RAM for the most important data\n# cache in MySQL. Start at 70% of total RAM for dedicated server, else 10%.\ninnodb_buffer_pool_size = 128M\n\n# Remove leading # to turn on a very important data integrity option: logging\n# changes to the binary log between backups.\n# log_bin\n\n# These are commonly set, remove the # and set as required.\nbasedir = /usr/local/webserver/lnmp/mysql \ndatadir = /usr/local/webserver/lnmp/mysql/3306/data\nport = 3306\nsocket = /tmp/mysql.sock \n\nuser=mysql\nsymbolic-links=0\n\n[mysqld_safe]\nlog-error=/usr/local/webserver/lnmp/mysql/3306/mysql_error.log\npid-file=/usr/local/webserver/lnmp/mysql/3306/mysqld.pid\n# Remove leading # to set options mainly useful for reporting servers.\n# The server defaults are faster for transactions and fast SELECTs.\n# Adjust sizes as needed, experiment to find the optimal values.\n# join_buffer_size = 128M\n# sort_buffer_size = 2M\n# read_rnd_buffer_size = 2M \n\nsql_mode=NO_ENGINE_SUBSTITUTION,STRICT_TRANS_TABLES </pre>\n<p>\n	<img class=\"tab\" style=\"width:0px;height:0px;\" />8.创建启动mysql shell脚本 <img class=\"tab\" style=\"width:0px;height:0px;\" />&nbsp;\n</p>\n<p>\n	<br />\n</p>\n<pre class=\"prettyprint brush:bash;\">vim /usr/local/webserver/lnmp/mysql/3306/mysql  </pre>\n<p>\n	<br />\n</p>\n<p>\n	输入以下内容&nbsp;\n</p>\n<p>\n	<br />\n</p>\n<pre class=\"prettyprint brush:bash;\">#!/bin/sh \n\nmysql_port=3306 \nmysql_username=\"root\" \nmysql_password=\"\" \n\nfunction_start_mysql() \n{ \n printf \"Starting MySQL...\\n\" \n /bin/sh /usr/local/webserver/lnmp/mysql/bin/mysqld_safe --defaults-file=/usr/local/webserver/lnmp/mysql/${mysql_port}/my.cnf 2&gt;&amp;1 &gt; /dev/null &amp;\n} \n\n function_stop_mysql() \n { \nprintf \"Stoping MySQL...\\n\" \n /usr/local/webserver/lnmp/mysql/bin/mysqladmin -u ${mysql_username} -p${mysql_password} -S /tmp/mysql.sock shutdown\n} \n\n function_restart_mysql() \n { \nprintf \"Restarting MySQL...\\n\" \nfunction_stop_mysql \nsleep 5 \nfunction_start_mysql \n } \n\n function_kill_mysql() \n { \nkill -9 $(ps -ef | grep \'bin/mysqld_safe\' | grep ${mysql_port} | awk \'{printf $2}\')  \nkill -9 $(ps -ef | grep \'libexec/mysqld\' | grep ${mysql_port} | awk \'{printf $2}\') \n } \n\n if [ \"$1\" = \"start\" ]; then \nfunction_start_mysql \n elif [ \"$1\" = \"stop\" ]; then \nfunction_stop_mysql \n elif [ \"$1\" = \"restart\" ]; then \n function_restart_mysql \n elif [ \"$1\" = \"kill\" ]; then \n function_kill_mysql \n else \nprintf \"Usage: /usr/local/webserver/lnmp/mysql/${mysql_port}/mysql {start|stop|restart|kill}\\n\"\nfi</pre>\n<p>\n	<br />\n</p>\n9.赋予shell脚本可执行权限：&nbsp;\n<pre class=\"prettyprint brush:bash;\">chmod +x /usr/local/webserver/lnmp/mysql/3306/mysql \n</pre>\n10.启动mysql&nbsp;\n<pre class=\"prettyprint brush:bash;\">/usr/local/webserver/lnmp/mysql/3306/mysql start</pre>\n<p>\n	<br />\n</p>\n<p>\n	<span style=\"line-height:1.5;\"><br />\n</span> \n</p>\n<p>\n	<span style=\"line-height:1.5;\"><br />\n</span> \n</p>\n<p>\n	以下为可选：\n</p>\n<p>\n	<span style=\"line-height:1.5;\">11.通过命令行登录管理MySQL服务器（提示输入密码时直接回车）：&nbsp;</span> \n</p>\n<p>\n	<span style=\"line-height:1.5;\"> </span> \n</p>\n<pre class=\"prettyprint brush:bash;\"> /usr/loca/webserver/lnmp/mysql/bin/mysql -u root -p -S /tmp/mysql.sock</pre>\n&nbsp;\n<p>\n	<br />\n</p>\n<p>\n	12.输入以下SQL语句，创建一个具有root权限的用户（eugene）和密码（123）&nbsp;\n</p>\n<p>\n	<br />\n</p>\n<pre class=\"prettyprint brush:bash;\"> GRANT ALL PRIVILEGES ON *.* TO \'eugene\'@\'localhost\' IDENTIFIED BY \'123\'; \nGRANT ALL PRIVILEGES ON *.* TO \'eugene\'@\'127.0.0.1\' IDENTIFIED BY \'123\';</pre>\n<p>\n	<br />\n</p>\n<p>\n	13.修改root密码&nbsp;&nbsp;\n</p>\n<p>\n	<br />\n</p>\n<pre class=\"prettyprint brush:bash;\"> GRANT ALL PRIVILEGES ON *.* TO \'root\'@\'localhost\' IDENTIFIED BY \'123\' with GRANT OPTION; \nGRANT ALL PRIVILEGES ON *.* TO \'root\'@\'127.0.0.1\' IDENTIFIED BY \'123\' with GRANT OPTION; flush privileges;</pre>\n<p>\n	<br />\n</p>\n14.停止MySQL：&nbsp;<br />\n<pre class=\"prettyprint brush:bash;\"> /usr/local/webserver/lnmp/mysql/3306/mysql stop</pre>\n<br />','14',1371964620,1372065096,'public');
